import React from "react";
import useGitProjectCalculator from "../../container/gitprojects/gitProjectCalculator";
//
import GitProject from "./GitProject";
const LangGenerator: React.SFC = () => {
  const { gitLangFreq, gitLangs, isLoading } = useGitProjectCalculator();

  if (isLoading) {
    return <p>Loading</p>;
  }

  console.log(gitLangFreq);

  return (
    <React.Fragment>
      {gitLangFreq &&
        gitLangFreq.map((k) => {
          return <GitProject language={k} ammount={k[k]} />;
        })}
    </React.Fragment>
  );
};

export default LangGenerator;
